            OpenAI was founded in December 2015 by Elon Musk, Sam Altman, Greg
            Brockman, Ilya Sutskever, Wojciech Zaremba, and John Schulman.
          </p>


          <div className="chatIcons">
            
          </div>
      </div>
  );
}
